import React from "react";

function NewItemPopup() {
//   const isShown = false;

  return (
    <div class="new-item-popup">
        <div className="new-notebook row">
            <p>Notebook</p>
        </div>
        <div className="new-dataset"></div>
        <div className="new-chart"></div>
    </div>
  );
}

export default NewItemPopup;
